// src/pages/ICCPage.tsx
import React from 'react';
import ICCChart from '@/components/ICCChart';
import { isValidICCSetup, getOutcomeColor, parseICCTags } from '@/utils/ICCSetupHandler';
import type { ICCSetup } from '@/types/ICC';

const mockICCSetup: ICCSetup = {
  symbol: 'AAPL',
  timeframe: '5m',
  iccTags: ['Breakout', 'TrendContinuation'],
  priceAtTrigger: 187.45,
  outcome: 'Triggered',
  timeBlock: 'Open',
  bot: 'MomentumEdgeBot',
  dashboard: 'MomentumEdge',
  data: [
    { time: '09:30', open: 187.00, high: 187.60, low: 186.90, close: 187.45, vwap: 187.30 },
    { time: '09:35', open: 187.45, high: 187.80, low: 187.20, close: 187.70, vwap: 187.60 },
    { time: '09:40', open: 187.70, high: 188.00, low: 187.50, close: 187.90, vwap: 187.80 },
  ],
};

const ICCPage: React.FC = () => {
  const isValid = isValidICCSetup(mockICCSetup);
  const outcomeColor = getOutcomeColor(mockICCSetup.outcome);
  const tagString = parseICCTags(mockICCSetup.iccTags);

  return (
    <div className="icc-page" style={{ padding: '2rem' }}>
      <h2>ICC Setup Dashboard</h2>
      {isValid ? (
        <>
          <p>
            <strong>Symbol:</strong> {mockICCSetup.symbol}
          </p>
          <p>
            <strong>Tags:</strong> {tagString}
          </p>
          <p>
            <strong>Outcome:</strong>{' '}
            <span style={{ color: outcomeColor }}>{mockICCSetup.outcome}</span>
          </p>
          <ICCChart setup={mockICCSetup} />
        </>
      ) : (
        <p style={{ color: 'red' }}>Invalid ICC setup data.</p>
      )}
    </div>
  );
};

export default ICCPage;
